{'datasetid': 'fablabs', 'recordid': '026b4f133a39defaaaab8d15154f9dbaf7b3dae4', 'fields': {'city': 'Sofia', 'kind_name': 'fab_lab', 'links': '[{"url": "http://www.smartfablab.org/", "id": 973}]', 'capabilities': 'three_d_printing;cnc_milling;laser', 'url': 'https://www.fablabs.io/labs/smartfablab', 'name': 'Smart Fab Lab', 'email': 'team@smartfablab.org', 'coordinates': [42.6840207, 23.3321017], 'header_url': 'http://fablabs.io.s3.amazonaws.com/2017/01/28/13/50/17/f1045e22-5b21-47b5-b55f-ee09ea9db8ee/Smart Fab Lab .jpg', 'phone': '+359882041499', 'avatar_url': 'http://fablabs.io.s3.amazonaws.com/2017/01/28/11/13/59/61dbd1e1-8c10-4785-8bca-b667cf4a5b29/Smart Fab Lab .jpg', 'postal_code': '1046', 'longitude': 23.3321017000001, 'country_code': 'bg', 'latitude': 42.6840207, 'address_1': 'Sofia Center', 'address_notes': 'Smart Fab Lab is hosted at the Laboratory for Urban Design (http://transformatori.net/laboratory-urban-design/), which is a working space at the backyard of the University of Architecture, Civil Engineering and Geodesy in Sofia.', 'address_2': '1 Hristo Smirnenski Street', 'blurb': 'Smart Fab Lab (SFL) is the first fab lab in Bulgaria.It specializes in smart cities, smart objects and smart mobile apps for design and manufacturing.', 'description': 'Smart Fab Lab (SFL) is the first fab lab in Bulgaria. It is hosted at the Laboratory for Urban Design, which is a working space at the backyard of the University of Architecture, Civil Engineering and Geodesy in Sofia. 

The three main areas in which SFL is specialised are:
1) Smart cities - smart cities, smart buildings, smart architecture, smart transformations of public spaces;
2) Smart objects - smart sensors, wearable devices/sensors, smart objects, smart mobile device accessories, smart clothing and accessories, the Internet of Things (IoT); 
3) Smart mobile apps for design and manufacturing - mobile apps for 3D and collaborative design and personal manufacturing, mobile device accessories.

SFL was founded in the summer of 2013 by Transformatori Association (http://transformatori.net/en/), Digital Spaces Living Lab (http://www.digitalspaces.info/) and private investors.'}, 'geometry': {'type': 'Point', 'coordinates': [23.3321017, 42.6840207]}, 'record_timestamp': '2017-03-22T16:28:59+00:00'}
